import React from 'react'
import { useNavigate } from 'react-router-dom';
import { Nav, NavLink } from './HeaderElements';

const Header = () => {
    let navigate = useNavigate();

    return (
        <Nav>
            <NavLink onClick={() => {
                navigate('/')
            }}>
                <span>Julian van Beek</span>
                <span>Web Designer</span>
            </NavLink>
        </Nav>
    );
}

export default Header;
